import React from 'react';

function Languages() {
  return (
    <div>
      <h2 className="languages-spoken">Languages Spoken</h2>
      <ul className="pentalingual">
        <li>English</li>
        <p>
          English is my mother tongue, due to this it is my strongest language.
        </p>
        <li>French</li>
        <li>Mandarin</li>
        <li>Spanish</li>
        <li>Italian</li>
      </ul>
    </div>
  );
}

export default Languages;
